import React, { useState, useEffect } from "react";
import "./TimeWithAnimals.css";

const TimeWithAnimals = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    phone: "",
    activity: "",
    day: "",
    hour: "",
    message: "",
  });

  const [submitted, setSubmitted] = useState(false);

  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Wysano zgoszenie:", formData);
    setSubmitted(true);
    setFormData({
      name: "",
      email: "",
      phone: "",
      activity: "",
      day: "",
      hour: "",
      message: "",
    });
  };

  // Generowanie godzin 9:00 - 19:00 co 30 minut
  const generateHours = () => {
    const hours = [];
    for (let h = 9; h <= 19; h++) {
      hours.push(`${h}:00`);
      if (h !== 19) hours.push(`${h}:30`);
    }
    return hours;
  };

  return (
    <section
      className="time-container"
      style={{
        backgroundImage: "url(/img/time-with-dog.jpg)",
        backgroundSize: "cover",
        backgroundPosition: "center",
        position: "relative",
        overflow: "hidden",
      }}
    >
      <div className="time-bg"></div>

      <div className="time-header">
        <h1>Spd藕 czas ze zwierzakiem</h1>
        <p>Pom贸偶 nam i spd藕 cudowne chwile z naszymi podopiecznymi </p>
      </div>

      <div className="time-content">
        <div className="time-info">
          <h2>Jak mo偶esz pom贸c?</h2>
          <p>
            Nie musisz by wolontariuszem, aby pom贸c naszym zwierzakom! Mo偶esz:
          </p>
          <ul>
            <li> Wyprowadzi psa na spacer</li>
            <li> Pobawi si z kotem</li>
            <li>Ч Pom贸c w sprztaniu boks贸w</li>
            <li> Spdzi z nimi troch czasu i da im uwag</li>
          </ul>

          <p>
            Zadzwo do nas: <strong>+48 123 123 123</strong> lub wypenij formularz,
            a odezwiemy si do Ciebie!
          </p>
        </div>

        <div className="time-form">
          <h2>Zgo ch udziau</h2>

          {submitted ? (
            <div className="form-success">
              <p>Dzikujemy! Skontaktujemy si z Tob wkr贸tce </p>
            </div>
          ) : (
            <form onSubmit={handleSubmit}>
              <label htmlFor="name">Imi i nazwisko:</label>
              <input
                type="text"
                id="name"
                name="name"
                placeholder="Wpisz swoje imi i nazwisko"
                value={formData.name}
                onChange={handleChange}
                required
              />

              <label htmlFor="email">Adres e-mail:</label>
              <input
                type="email"
                id="email"
                name="email"
                placeholder="Tw贸j e-mail"
                value={formData.email}
                onChange={handleChange}
                required
              />

              <label htmlFor="phone">Telefon (opcjonalnie):</label>
              <input
                type="tel"
                id="phone"
                name="phone"
                placeholder="Numer telefonu"
                value={formData.phone}
                onChange={handleChange}
              />

              <label htmlFor="activity">Wybierz aktywno:</label>
              <select
                id="activity"
                name="activity"
                value={formData.activity}
                onChange={handleChange}
                required
              >
                <option value="">-- wybierz --</option>
                <option value="spacer">Spacer z psem</option>
                <option value="zabawa">Zabawa z kotem</option>
                <option value="sprzatanie">Sprztanie boks贸w</option>
                <option value="inne">Inne</option>
              </select>

              <label htmlFor="day">Wybierz dzie:</label>
              <select
                id="day"
                name="day"
                value={formData.day}
                onChange={handleChange}
                required
              >
                <option value="">-- wybierz dzie --</option>
                <option value="poniedziaek">Poniedziaek</option>
                <option value="wtorek">Wtorek</option>
                <option value="roda">roda</option>
                <option value="czwartek">Czwartek</option>
                <option value="pitek">Pitek</option>
                <option value="sobota">Sobota</option>
                <option value="niedziela">Niedziela</option>
              </select>

              <label htmlFor="hour">Wybierz godzin:</label>
              <select
                id="hour"
                name="hour"
                value={formData.hour}
                onChange={handleChange}
                required
              >
                <option value="">-- wybierz godzin --</option>
                {generateHours().map((h, i) => (
                  <option key={i} value={h}>
                    {h}
                  </option>
                ))}
              </select>

              <label htmlFor="message">Dodatkowe uwagi:</label>
              <textarea
                id="message"
                name="message"
                rows="5"
                placeholder="Np. preferowany pies, dowiadczenie ze zwierztami..."
                value={formData.message}
                onChange={handleChange}
              ></textarea>

              <button type="submit">Wylij zgoszenie</button>
            </form>
          )}
        </div>
      </div>
    </section>
  );
};

export default TimeWithAnimals;
